import React from 'react';
import { Navbar, Nav, Container } from 'react-bootstrap'
import { FileX, PersonCircle } from 'react-bootstrap-icons';
const custom_style={fontWeight:"bold",marginLeft:"50px"};
const custom_style_logo={fontWeight:"900",marginLeft:"50px"};
function NavbarComponent(userDetails){
    return (
        <div>
            <Navbar bg="light" variant="light">
                <Container>
                    <Navbar.Brand href="#home" style={custom_style_logo}>Crack off Campus</Navbar.Brand>
                    <Nav className="me-auto">
                        <Nav.Link href="home" style={custom_style}>Jobs</Nav.Link>
                        <Nav.Link href="referals" style={custom_style}>Referals</Nav.Link>
                        <Nav.Link href="post" style={custom_style}>Post Job</Nav.Link>
                    </Nav>
                    <div style={{display:'flex',justifyContent:'space-between'}}>
                    <PersonCircle style={{ marginRight:"7px"}} id="logo_account" title = "goodbye" color="#000" size={25} />
                    <p>{userDetails.userName}</p>
                    </div>
                    

                </Container>
            </Navbar>
        </div >
    )
}

export default NavbarComponent;

